export function hc(s, p) {
  let h = 0;
  for (let i = 0; i < s.length; i++) h = ((h << 5) - h + s.charCodeAt(i)) | 0;
  return p + String((Math.abs(h) % 9000) + 1000);
}
export const CC = {};
